import { Route } from "react-router-dom";

export default function PrivateRoute({component: Component, ...rest}) {
    return (
        /*  <Route exact={props.exact} path={props.path} component={props.component}> */     
        <Route {...rest}>
            <Component />
        </Route>
    );
}
